import 'package:ieca_mobile/_import.dart';

class UmHymnsUcitoWaNalaYesu {
  static List<HymnsContent> list = [
    HymnsContent(id: 1730, position: 1, content: "Vimbo lina lia Ndaviti,\nMua citiwa oñaña.\nVonjo yimue yolongombe\nIna’e wo pekelisa.\nNyoho yaye Maria,\nYesu eye oñaña.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_33, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1731, position: 2, content: "Kilu oko a tundile,\nWa kaile ale lulamba.\nWeya toke konjo yaño,\nOko a citiwila.\nWa likapa kutito\nHa tu nenela eyovo.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_33, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1732, position: 3, content: "Lokutila waye wosi,\nEye wa eca ongangu.\nWa pokola kolonjali,\nVina viaye viokoluali.\nLetu vosi tumãla\nTu yongola oku u kuama.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_33, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1733, position: 4, content: "Kuenje tu ko mola eteke,\nTu pitila ku Suku.\nKonjo yaño yolongombe,\nHakoko te kovailu.\nEye o ka tu yolela,\nTu ka kala kumue la'e.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_33, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1734, position: 1, content: "A Mbeteleme ko Yudea,\nAkaimbo ka Ndaviti.\nOmanu vove va pekela,\nVakuanumbi ya lua.\nPuãi volokololo viove\nMua tuila ocinyi ca tua,\nCa tu kokela elavoko\nLievi vi li oku iya.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_34, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1735, position: 2, content: "Ukristu wa citiwa,\nKepata lia Ndaviti.\nMesiya yohuminyo weya,\nKa vo limbukile.\nOmanu va pasuke,\nIsungo vi yevale\nVa tumbangiye u wa tu iha\nOmbembua kuenda esanju.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_34, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1736, position: 3, content: "A Yesu Kristu enju,\nNdo iñile vimbo lietu.\nOhondo yove tu yi yanguisa;\nLinga Ukombe wetu.\nTua yeva ovangelo\nLisungo vio Natale,\nPuãi ove muele tu ku sole;\nKala kumue letu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_34, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1737, position: 1, content: "Anjovoli, wa sia ulamba wa piãlã\nEci wa njiyilila koluali;\nPuãi ko Mbeteleme omanu va likala\nOku ku iha ohondo yoye.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1738, content: "Enju a Yesu, vutima wange\nOmo mu li ohondo yove.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_35, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1739, position: 2, content: "Ovangelo va lua va ku sivaya,\nVa ku imbila ulamba wa lua;\nPuãi wa citiwila kusuke lokepembe,\nHu popela olosuke viosi.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1740, position: 3, content: "Weyilila, a Ñala, eyovo liomanu,\nWeya lelomboluilo liomuenyo,\nPuãi va inasi eyovo; va ponda Onjovoli,\nVa pukula ohenda yaye.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1741, position: 4, content: "Eci wiya vali lulamba wa piãla,\nKuenje angelo va ku sambiliya,\nNjeve ondaka yove yohenda locisola\nYiti, Enju konele yange.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1742, content: "Kuenje utima u sanjukila\nElaleko liohenda yove.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_35, typeStanza: HymnsContentCode.CHOIR),

    HymnsContent(id: 1743, position: 1, content: "A Cinyi ca tua, ci kola,\nNdeci wa tuila olonoño\nHu vi songuila ko Mbeteleme\nHaico etali tu songuile.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1744, content: "Yeveleli ocisungo\nCovangelo vokulamba.\nVa tu imbila ondaka yiwa\nYombembua ya Suku,\nYeya komanu,\nYombembua ya Suku\nYeya komanu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_36, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1745, position: 2, content: "A cinyi, ndeci wa tuila,\nVonjo yakombe ko Yudea,\nHaico ndo tuile volonjo vietu,\nOco mu kale onjelo yove.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1746, position: 3, content: "A cinyi, nda tu nyikiwa,\nLevi vi tekavaisa itima\nOmbembua yove yi tu sanjuise,\nKuenda yi lembe evalo liosi.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1747, position: 4, content: "A cinyi ca tua cohenda,\nNdeci wa tuila kocililo\nHaico wa tuila komindikiso,\nHu malusula eyovo lietu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_36, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1748, position: 1, content: "Avakuetavo, enjui lonjolela,\nTu endi lombili ko Mbeteleme.\nTu ka yolela Onjovoli yetu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1749, content: "Enjui, tu ko fendeli.(3x)\nKristu Ñala yetu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_37, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1750, position: 2, content: "Suku o kola, haye ukuolamba,\nWeya ndomunu oku tunga letu.\nSuku yocili, haeye wa kemãla.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1751, position: 3, content: "Imbi angelo, imbi asivayo,\nImbi, amanu vosi lonjolela.\nPosi lokilu tumbangiyi Suku.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1752, position: 4, content: "Tu sambiliyi Onjovoli yetu,\nWeya lesepu oku tu popela.\nWa tukuluka Ndaka ya Yehova.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_37, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1753, position: 1, content: "Konjo yimue yolongombe\nKua moleha ocikomo,\nKo Natal yatete.\nOkañaña ka langekua\nVocililo convinyama\nKo Natal yatete.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1754, position: 2, content: "Ocipepi limbo liaco\nOvangombo va lendela,\nKo Natal yatete.\nKua va tuila ocinyi ca tua\nKua moleha ovangelo\nKo Natal yatete.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1755, position: 3, content: "Ovangelo va imba oluiya\nLuonjovoli ya citiwa,\nKo Natal yatete.\nOvangombo va enda vimbo\nVa fendela oñaña yaco\nKo Natal yatete.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1756, position: 4, content: "Olumbungululu lua tua\nLua songuila olonoño\nKo Natal yatete.\nVa votoka lekolelo\nVa pitila lonjolela\nKo Natal yatete.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_38, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1757, position: 1, content: "Olomunga viokilu\nVia sivaya Yehova,\nWa katula Omolahe\nHeya posi lombembua.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_39, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1758, position: 2, content: "Eye Soma yitima,\nUkuanjelo,  ukuesunga,\nUkuotanya womuenyo,\nUkuolamba wa Suku.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_39, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1759, position: 3, content: "Wa sia ulamba wokilu,\nWa likapa kutito,\nHa yovola omanu\nVa nyelela lakandu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_39, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1760, position: 4, content: "Tu panduila ucito wa'e,\nWa tu muisa esanju.\nTu sivayi ukuahenda,\nYesu, Soma ka yi pui.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_39, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1761, position: 1, content: "Ovangelo vokulamba \nVeya ko Mbeteleme,\nHaivo va imba esivayo\nCina oluali lua sowiwa.\nTu endi vosi ha tu tali \nUpopeli, Yesu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_40, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1762, position: 2, content: "Ovangombo vokusenge \nVeya ko Mbeteleme,\nYu va sanga Mõla a Suku,\nUna angelo vo sivaya.\nTu endi vosi ha tu tali \nUpopeli, Yesu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_40, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1763, position: 3, content: "Olonoño viokupãla \nVieya ko Mbeteleme,\nYu va ambata olombanjaile\nVioku lumba ko Mesiya.\nTu endi vosi ha tu tali \nUpopeli, Yesu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_40, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1764, position: 4, content: "Olosandu viosiahũlu \nVieya ko Mbeteleme,\nVia lavoka tunde nunde\nOku mola Omesiya.\nTu endi vosi ha tu tali \nUpopeli, Yesu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_40, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1765, position: 1, content: "Alongunga, siki.\nAtumãla, imbi.\nYevalisi esapulo\nLionjovoli ya citiwa.\nSanjukili ohenda\nYa tu lingiwila.\nKa fendeli lesumbilo\nYesu, Soma yetu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_41, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1766, position: 2, content: "Alongunga, siki.\nAtumãla, imbi.\nOco olofeka viosi\nVi yolele ondaka yiwa,\nYocisungo cina\nCa imba ovangelo,\nCoku lombolola ombembua\nYeyilila omanu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_41, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1767, position: 3, content: "Alongunga, siki.\nAtumãla, imbi.\nKuendi kumue lovangombo\nOku tala ocikomo.\nKumue lolonoño\nTuali ulambu wene.\nKu Una wa sia ulamba waye\nHa tu muisa eyovo.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_41, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1768, position: 1, content: "Eci ovangombo vamue,\nVa lava oviunda viavo;\nVa mola ocisalu,\nYu va yokoka ca lua.\nKua va tuila ocinyi ca tua,\nUngelo wa moleha,\nWa va imba onumbi yiwa.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1769, position: 2, content: "Hati, ko ka yokoki,\nNdeya londaka yiwa;\nOndaka yonjolela,\nYeya komanu vosi.\nMomo vimbo lia Ndaviti,\nMua citiwila Oñaña,\nYi linga Onjovoli!", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1770, position: 3, content: "Angombo va votoka,\nVa enda lesanju lia lua;\nVa sanga Oñaña yaco\nYi langi vocililo.\nVo fendela lesumbilo,\nYu eci va tundako\nVa tumbangiya Suku.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1771, position: 4, content: "Ndeci ovangombo vaco,\nHaico letuvo etali;\nTu sanjukili oluiya\nLua imbile ovangelo.\nTu votoki lekolelo,\nHa tu fendela Oñaña\nYa tu nenela eyovo.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_42, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1772, position: 1, content: "Uteke umue, ovangombo va Yuda\nVa tata tata oviunda viavo.\nUngelo wa tunda ku Suku kilu,\nWa vangula lovangombo ondaka eyi.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1773, content: "Natal! Natal! Natal! Natal!\nEtali vo cita osoma yetu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_43, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1774, position: 2, content: "Va mola olumbungululu\nLua tua tue kupãla pãla.\nOcinyi caco ca va songuila\nKo Mbeteleme, Koñaña yaco.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1775, position: 3, content: "Olonoño vitatu via songuiwa,\nVia tunda kutundilo, kupãlapãla.\nVia sanga oñaña vocimanga caño\nVio fendela, vio wiha olombanjaile viavo.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_43, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1776, position: 1, content: "Uteke! U kola!\nKuenje ocinyi ca moleha\nKuna Ñaña a pekela,\nVocililo colongombe;\nWa pekela lombembua,\nOmbembua yokovailu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1777, position: 2, content: "Uteke! U kola!\nOvangombo va moleha\nOmo ocinyi ca va tuila;\nOvangelo va imba isungo\nVati, Ulamba ku Suku,\nPosi ombembua komanu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1778, position: 3, content: "Uteke! U kola!\nOlonoño ku tundilo\nVa enda lolumbungululu,\nVa lu kuama ta ku SOMA\nVo lambuila ulambu,\nYesu Onjovoli yoluali.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1779, position: 4, content: "Uteke! U kola!\nTu songuile, Acinyi\nColumnbungululu lua tua;\nTu imbe kumue lovangelo:\nKilu ulamba ku Suku,\nPosi ombembua komanu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_44, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1780, position: 1, content: "Angombo va tata oviunda\nPokati kuteke.\nUngelo wa Suku weya,\nOcinyi ca taima.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1781, content: "Hati, ko ka kuati usumba,\nMomo va luluma.\nKovailu, ulamba ku Suku,\nLo posi, ombembua.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_45, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1782, position: 2, content: "Etaili vimbo lia Daviti\nMua citiwa omõla,\nVo luka onduko ya'e Yesu,\nO linga Onjovoli.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1783, position: 3, content: "Ovangombo va sivaya\nLocisungo cokilu:\nKovailu ulamba ku Suku,\nLoposi ombembua.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1784, position: 4, content: "Vosi va tumbangiye\nLocisungo cilo:\nKovailu ulamba ku Suku,\nLoposi ombembua.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_45, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1785, position: 1, content: "Enju a Yesu, a Mesiya yetu\nHu pandulula omanu vove;\nVa kasi ño lelamba lupongo,\nToke Onjovoli yi moleha.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_46, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1786, content: "Yoleli! Yoleli!\nMesiya o keya\nHa ku yovola, a Isaleli!", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_46, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1787, position: 2, content: "Enju a Ñala, a mõla a Daviti\nNdo viale lekemalo liove;\nImula ukukui wetu wutima\nLukuasi wocisola cove.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_46, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1788, position: 3, content: "Enju, a Ñala, lolohõlo viove,\nNdeci wa molehele osimbu\nKovaprofeto vakuaspiritu\nOco ohuminyo yi telisue.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_46, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1789, position: 4, content: "Enju, a Ñala, a Cinyi cokilu\nImula owelema wetu.\nSandula alende oku nyumala,\nUtanya wove u tu tuile.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_46, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1790, content: "Yoleli! Yoleli!\nMesiya o keya\nOku yovola, va Isaleli!", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_46, typeStanza: HymnsContentCode.CHOIR),

    HymnsContent(id: 1791, position: 1, content: "Omanu va sima ndati,\nOku enda ko Mbeteleme?\nKua moleha ocinyi ca tua\nCi kasi oku nina;\nCa lekisiwa lungelo\nKovangombo va  kuiya;\nOsoma ya tuma Suku\nYa tu citilua.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_47, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1792, content: "Enjui yeveleli esapulo\nLieyilila kutundilo:\nMesiya, Soma yulamba\nYa tu citilua.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_47, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1793, position: 2, content: "A luali lua sumua, pasuka,\nAlienge ove a kutuluka;\nEpito okuete lia yuluka,\nTunda vokayike,\nKu ka tatãle loku suma,\nEsumuluho lieya;\nYesu Eye Ukuonene,\nWa tu citilua.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_47, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1794, position: 3, content: "Yevelela, lekomoho:\nTunda vevalo losõi.\nOku li siosiõla ku imuhe\nOkuete Upopeli;\nOmbembua Suku a nena\nOyonguila omanu uwa;\nOnena Ombembua yocili;\nWa tu citilua.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_47, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1795, position: 1, content: "Kuli isungo kilu!\nLolumbungululu\nKuli onjali yi lemba,\nOñaña yi lila.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_48, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1796, content: "Luatua olumbugululu;\nLu lekisa ulamba,\nVimbo lia Mbeteleme\nMua citiwa Ñala.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_48, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1797, position: 2, content: "Va yolela calua,\nOmo Ñala weya!\nOmola wu feko,\nOlinga Osoma.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_48, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1798, position: 3, content: "Ocinyi ca fina,\nCa tuila oluali.\nLocisungo cokilu,\nCeya palo posi.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_48, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1799, position: 4, content: "Ulamba ku Ñala\nWa lokila posi!\nLocisola caye,\nYu wa tunga letu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_48, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1800, position: 1, content: "Vimbo lia Mbeteleme\nMua lokila Ovangelo;\nVa nena Ondaka yiwa,\nYa Ñala komanu   vosi.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_49, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1801, content: "Glória in excelsis Deo!\nGlória in excelsis Deo.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_49, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1802, position: 2, content: "Lesanju angombo va enda\nOku lama Osoma;\nVa eca ovivanda viavo,\nNdocilumba comanu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_49, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1803, position: 3, content: "Enjui vanji vocililo,\nOñaña haeye Upopeli;\nKekami loku U lama\nLesumbilo, lulamba.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_49, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1804, position: 1, content: "Vosi yoleli; Yesu weya;\nSivayi onduko yaye.\nVialeki Soma yene. (2x)\nOsoma yenda hũ. (3x)", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_50, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1805, position: 2, content: "Vosi yoleli, Yesu o viala;\nLimbuki unene waye.\nYoleli uviali waye. (2x)\nUviali wenda hũ. (3x)", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_50, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1806, position: 3, content: "Imula ongusu yovakandu;\nLongongo kuenda okufa.\nO sanjowaisa omanu. (2x)\nOtembo yenda hũ. (3x)", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_50, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1807, position: 4, content: "O viala omanu lolondunge;\nLesunga kuenda ohenda.\nUlamba wa'e wa piãlã. (2x)\nOsoma yenda hũ. (3x)", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_50, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1808, position: 1, content: "Sapuiliko vosi omanu koluali;\nKuosi kuli ohali cilo va yovoka\nAlimi a vosi va tuale oluiya:\nUpopeli weya!", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_51, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1809, content: "Upopeli weya! Upopeli weya!\nTate yetu kilu wa tu iha omola'e.\nSapuiliko vosi omanu koluali:\nUpopeli weya!", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_51, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1810, position: 2, content: "Uteke wapita, ongula ya toka,\nElamba lia imuha, lovoveyi osi;\nTuamela ko ola, yi pitila ndopo:\nUpopeli weya!", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_51, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1811, position: 3, content: "Tali Soma weya ha popela vosi,\nOku panduluka kupika wakandu.\nVosi vovo, va imba lonjolela isungo:\nUpopeli weya!", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_51, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1812, position: 4, content: "Ohenda ya Yesu yi tu komohisa,\nHelie otela ndeye oku sola omanu.\nAme ndu kuevihõ ñala ndeci Yesu:\nUpopeli weya!", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_51, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1813, position: 5, content: "Amanu sapuli, apata sanjuki,\nEvalo liosi pe, kaku kala vali;\nYesu wa citiwa, panduli Yehova!\nUpopeli weya!", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_51, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1814, position: 1, content: "Yevi angelo vovo va imba,\nSoma yetu wa citiwa.\nVati kilu lieve ombembua,\nKuava va kuesunguluko;\nYoleli alofeka viosi;\nSambiliyi upopeli,\nImbi kumue lovangelo;\nKristu weya ko Mbeteleme.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_52, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1815, content: "Yevi angelo vovo va imba,\nSoma yetu wa citiwa.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_52, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1816, position: 2, content: "Kristu wa kemãla kilu,\nWa sumbiwa lovangelo;\nHaimo weya kilu lieve,\nEye uveli wa inahe.\nNdaka yu wa linga omunu;\nWa likapa ndomo ohukui,\nHá inalisa apata osi;\nEye Kristu Soma yetu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_52, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1817, position: 1, content: "Tulosoma, tua tunda kupãla;\nTuoku ambata olombanjaile,\nKolomunda, lokanyala,\nTua pita lelavoko.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_53, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1818, content: "Alumbungululu lua posoka;\nLua tua locinyei ci kola;\nTu songuile, hu tu tuala,\nKimbo lie lavoko lietu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_53, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1819, position: 2, content: "Ame ulu wa fina nda nena,\nSi lekisa Usoma wa piãla,\nSoma yenda ño hũ ka yi pui,\nO viala lekemãlo.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_53, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1820, position: 3, content: "Ekokoto li kola nda nena,\nLioku ilika ulamba wa Suku.\nVosi vo fendele ocili;\nLesanju lesumbilo.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_53, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1821, position: 4, content: "Okanguendu ka tĩla nda nena,\nNdocilai cokufa kua Soma,\nNda lekisa olohali,\nVisanga Onjovoli.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_53, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1822, position: 5, content: "O pinduka, wa piãla,\nEkemalo lia lua O sanga;\nAleluya! Aleluya!\nEyovo weya lalio.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_53, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1823, position: 1, content: "Vocililo colongombe ka muli ula\nWoku pekelisa Yesu oñaña.\nOlumbungululu lua taima kilu;\nVocililo colongombe Yesu wa pekela.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_54, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1824, position: 2, content: "Olongombe via lila viapasula oñaña\nPuãi Yesu okañaña ka lila lila;\nHu sole a Ñala ka ndengelele\nKala konele yange, te kuca omele.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_54, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1825, position: 3, content: "Hu pinga oku kala ocipepi lame,\nOlonjanja viosi loku solavo ame;\nVa sumuluisevo otumãla tuosi,\nVa tate tatevo ka va kala kilu.", hymnsNumber: UmHymnsNumberSeeder.UCITO_WA_NALA_YESU_54, typeStanza: HymnsContentCode.VERSE),

  ];
}